/* eslint-disable prettier/prettier */
import styled from 'styled-components';

const IndexGrid = styled.div`
  #grid{
    display: grid;
    grid-gap: 0;
    padding: 0;
    margin: 0;
    grid-template-columns: 20vw 30vw 30vw 20vw;
    grid-template-rows: 100vh 25vh 25vh 25vh 25vh;

    #slideshow{
      grid-row: 1;
      grid-column: 1 / 5;
      padding: 0;
      margin: 0;
      max-height: 100vh;
      max-width: 100vw;
    }



    #female {
      grid-row: 3 / 6;
      grid-column: 2;
      padding: 0;
      margin: 0;
      max-height: 75vh;
      max-width: 30vw;
    }
  }
`;

export default IndexGrid;
